<!DOCTYPE html>

<head>
    <meta http-equiv="content-type" content="text/html; charset=utf-8" />
    <meta http-equiv="X-UA-Compatible" content="IE=edge"/>
    <link rel="stylesheet" href="../css/main.css" type="text/css" />
    <script type="text/javascript" src="../lib/jquery-1.7.2.min.js"></script>
    <script type="text/javascript" src="../lib/log4javascript_lite.js"></script>
    <script type="text/javascript" src="../lib/jquery.qtip.js"></script>
    <script type="text/javascript" src="../lib/jquery.form.js"></script>
    <script type="text/javascript" src="../lib/jquery.corner.js"></script>
    <script type="text/javascript" src="../lib/aes.js"></script>
    <script type="text/javascript" src="../lib/hmac-sha256.js"></script>
    <script type="text/javascript" src="../lib/pbkdf2.js"></script>
    <script type="text/javascript" src="../lib/scram.js"></script>

    <script type="text/javascript" src="../js/main.js"></script>
    <script type="text/javascript" src="../js/redirect.js"></script>
    <script type="text/javascript" src="../js/stk.js"></script>
    <script type="text/javascript" src="../js/checklogin.js"></script>
    <script type="text/javascript" src="../js/validation.js"></script>
</head>
<body>
<div id="all_content" class="body_bg">
    <div id="wrapper" class="wrapper_dim">
        <div class="wrapper_dim wrapper_filter">
            <div id="header"></div>
            <div class="stk_content">
                    <div class="status_title clr_blue_title_h2"><h2 id="stk_head_inf"></h2></div>
                    <div class="stk_main_content">
                            <table border="0" cellpadding="0" cellspacing="0" class="stk_table">
                                <tr>
                                    <td class="stk_menu clr_blue_hover clr_bold_a" valign="top">
                                    <ul id="list_stk_menu">
                                    </ul>
                                    </td>
                                    <td id="stk_unsupported">
                                    </td>
                                </tr>
                                <tr class="stk_jump">
                                    <td>
                                       <div class="stk_pagination" id='stk_pagination'>
                                           <span class="stk_page_tool">
                                               <span class="stk_span">
                                                   <a class="pageBegin" id="pageBegin">&nbsp;</a>
                                               </span>
                                               <span class="stk_span">
                                                   <a class="prePage" id="prePage">&nbsp;</a>
                                               </span>
                                               <span class="page_num clr_bold_a" id="page_num"></span>
                                               <span class="stk_span">
                                                   <a class="nextPage" id="nextPage">&nbsp;</a>
                                               </span>
                                               <span class="stk_span">
                                                   <a class="pageLast" id="pageLast">&nbsp;</a>
                                               </span>
                                           </span>
                                       </div>
                                    </td>
                                </tr>
                                <tr>
                                    <td align="center" valign="middle">
                                        <div>
                                            <script type="text/javascript">create_button(common_back,'stk_back_page');</script>
                                        </div>
                                    </td>
                                </tr>
                            </table>
                    </div>
            </div>
            <div id="footer" class="footer"></div>
        </div>
    </div>
</div>
